import React, {Component} from 'react'

class Profile extends Component {

	componentDidMount() {
		console.log(this.props.user.avatar.url)
	}

	render() {
		return (
			<div className="ui divided items">
				<div className="item">
					<div className="ui avatar circular image"><img src="/images/wireframe/image.png"/></div>
					<div className="content"><a className="header">Content Header</a>
						<div className="meta"><span>Date</span><span>Category</span></div>
						<div className="description">A description which may flow for several lines and give context to the content.</div>
					</div>
				</div>
			</div>
		)
	}
}

export default Profile
